nique // A pharmacist is linked to one pharmacy\n  pharmacy   Pharmacy? @relation(fields: [pharmacyId], references: [id])\n}\n\nmodel Appointment {\n  id                String            @id @default(uuid())\n  patientId         String\n  doctorId          String\n  appointmentTime   DateTime\n  status            AppointmentStatus @default(PENDING)\n  symptoms          String\n  consultationNotes String?\n\n  patient        PatientProfile  @relation(\"PatientAppointments\", fields: [patientId], references: [id])\n  doctor         DoctorProfile   @relation(\"DoctorAppointments\", fields: [doctorId], references: [id])\n  medicalRecords MedicalRecord[]\n}\n\nmodel MedicalRecord {\n  id            String   @id @default(uuid())\n  patientId     String\n  doctorId      String\n  appointmentId String\n  diagnosis     String\n  createdAt     DateTime @default(now())\n\n  patient     PatientProfile @relation(fields: [patientId], references: [id])\n  doctor      DoctorProfile  @relation(fields: [doctorId], references: [id])\n  appointment Appointment    @relation(fields: [appointmentId], references: [id])\n}\n\nmodel Pharmacy {\n  id           String  @id @default(uuid())\n  name         String\n  address      String\n  latitude     Float\n  longitude    Float\n  pharmacistId String? @unique // CHANGED: A pharmacy has one pharmacist\n\n  pharmacist    PharmacistProfile? // CHANGED: Now correctly relates to PharmacistProfile\n  stocks        PharmacyStock[]\n  MedicineBatch MedicineBatch[]\n  prescriptions Prescription[] // ADDED: Relation to incoming prescriptions\n}\n\nmodel Medicine {\n  id          String @id @default(uuid())\n  name        String\n  genericName String\n\n  stocks           PharmacyStock[]\n  MedicineBatch    MedicineBatch[]\n  PrescriptionItem PrescriptionItem[]\n  RefillReminder   RefillReminder[]\n}\n\nmodel PharmacyStock {\n  id          String      @id @default(uuid())\n  pharmacyId  String\n  medicineId  String\n  stockStatus StockStatus\n\n  pharmacy Pharmacy @relation(fields: [pharmacyId], references: [id])\n  medicine Medicine @relation(fields: [medicineId], references: [id])\n\n  @@unique([pharmacyId, medicineId])\n}\n\n// Track inventory by batches with expiry and quantities\nmodel MedicineBatch {\n  id          String   @id @default(uuid())\n  pharmacyId  String\n  medicineId  String\n  batchNumber String\n  quantity    Int\n  expiryDate  DateTime\n\n  pharmacy Pharmacy @relation(fields: [pharmacyId], references: [id])\n  medicine Medicine @relation(fields: [medicineId], references: [id])\n}\n\n// E-prescriptions created by doctors for patients\nmodel Prescription {\n  id         String             @id @default(uuid())\n  patientId  String\n  doctorId   String\n  pharmacyId String? // ADDED: Foreign key to link to a pharmacy\n  status     PrescriptionStatus @default(PENDING)\n  createdAt  DateTime           @default(now())\n\n  patient  PatientProfile     @relation(fields: [patientId], references: [id])\n  doctor   DoctorProfile      @relation(fields: [doctorId], references: [id])\n  pharmacy Pharmacy?          @relation(fields: [pharmacyId], references: [id]) // ADDED: Relation to the assigned pharmacy\n  items    PrescriptionItem[]\n}\n\nmodel PrescriptionItem {\n  id             String  @id @default(uuid())\n  prescriptionId String\n  medicineId     String\n  quantity       Int\n  instructions   String?\n  genericAllowed Boolean @default(true)\n\n  prescription       Prescription        @relation(fields: [prescriptionId], references: [id])\n  medicine           Medicine            @relation(fields: [medicineId], references: [id])\n  dosageInstructions DosageInstruction[]\n}\n\n// Multilingual dosage text per prescription item\nmodel DosageInstruction {\n  id                 String @id @default(uuid())\n  prescriptionItemId String\n  languageCode       String\n  text               String\n\n  prescriptionItem PrescriptionItem @relation(fields: [prescriptionItemId], references: [id])\n}\n\n// Refill reminders configured for chronic patients\nmodel RefillReminder {\n  id         String    @id @default(uuid())\n  patientId  String\n  medicineId String\n  schedule   String // cron-like or human readable schedule\n  nextRunAt  DateTime?\n  active     Boolean   @default(true)\n\n  patient  PatientProfile @relation(fields: [patientId], references: [id])\n  medicine Medicine       @relation(fields: [medicineId], references: [id])\n}\n\n// Generic notification entity for in-app alerts\nmodel Notification {\n  id           String    @id @default(uuid())\n  type         String\n  payload      Json\n  targetUserId String?\n  targetRole   Role?\n  createdAt    DateTime  @default(now())\n  readAt       DateTime?\n}\n",
